import React, { Component } from 'react';

class Gallery extends Component {
  render() {
    return (
      <div
        style={{
          display: 'block',
          minHeight: '1px',
          width: '100%',
          border: '1px solid #ddd',
          overflow: 'auto',
          textAlign: 'center',
          background: 'white',
        }}
      >
        <PhotoGallery images={images} enableImageSelection={false} />
